import React, { Component } from "react";
import { Container, Input, Button, Icon } from "semantic-ui-react";

class TopControl extends Component {
  state = {
    environment: ""
  };
  render() {
    return (
      <div className="topcontrol">
        <Container>
          <Input
            size="tiny"
            list="environment"
            placeholder="Environment..."
            name="environment"
            value={this.state.environment}
            onChange={this.inputHandler}
          />
          <datalist id="environment">
            <option value="develop" />
            <option value="production" />
            <option value="stage" />
          </datalist>
          <Button.Group icon floated="right" size="tiny" compact>
            <Button inverted>
              <span className="btnlabel">Start </span>
              <Icon name="play" circular color="violet" size="small" />
            </Button>
            <span className="buttondivider" />
            <Button inverted>
              <span className="btnlabel">Stop </span>

              <Icon name="pause" circular color="violet" size="small" />
            </Button>
          </Button.Group>
        </Container>
      </div>
    );
  }
}

export default TopControl;
